import React, { Component } from 'react';
import moment from 'moment';

class Todo extends Component {

  state = {
    id: 1,
    description: 'Learn Forms',
    targetDate: moment(new Date()).format('YYYY-MM-DD')
  }

  render() {
    return (
      <div>
        <h1>Todo</h1>
      </div>
    );
  }
}

export default Todo;
